import React, { Component } from 'react';
import Input from './Input';

class Experience extends Component {
    render() {
        const { changePosition, changeCompany, changeExperienceCity, changeStartExperience, changeEndExperience, edit } = this.props;
        return(
            <fieldset>
                <legend>Experience</legend>
                <Input name="Position" onChange={changePosition} edit={edit}/>
                <Input name="Company" onChange={changeCompany} edit={edit}/>
                <Input name="City" onChange={changeExperienceCity} edit={edit}/>
                <Input name="From" onChange={changeStartExperience} edit={edit}/>
                <Input name="To" onChange={changeEndExperience} edit={edit}/>
            </fieldset>
        )
    }
}

export default Experience;
